import GlobalImage from "./image"

import GlobalTitle from "./globalTitle"

function DescriptionBox({title, secondTitle}) {
return(
    <div className="about-me-top-side">
        <GlobalTitle 
            title={title} 
            secondTitle={secondTitle} />
        <GlobalImage />
    </div>)
}

export default DescriptionBox
